@SpringBootTest(classes = [FileService::class], properties = ["spring.web.resources.static-locations=./files"])
class FileServiceTest {
	@Autowired
	lateinit var fileService: FileService


	@DisplayName("1. 파일 업로드")
	@Test
	fun test_1() {
		val profile =
			FileReqDto.NewProfile("data:image/png;base64,")
		Assertions.assertThat(profile.extension).isEqualTo("png")
	}

	@DisplayName("2. ")
	@Test
	internal fun test_2() {
		SecurityContextHolder.getContext().authentication =
			UsernamePasswordAuthenticationToken(AuthToken(1, "test", listOf("ROLE_USER")), null)
		val profile =
			FileReqDto.NewProfile("data:image/png;base64,")
		val saveNewProfile = fileService.saveNewProfile(profile)
		println(saveNewProfile)
	}
}